	 ('Madden NFL 22','1639948377757.jpg','2021-12-19 21:12:57',NULL,NULL,9789,'Madden NFL 22 es donde se juega el partido. Es todo lo que amas de la NFL inyectado en cada modo mediante el nuevo d�a del partido din�mico. Tra�do a la vida por la IA de estrellas con estad�sticas de nueva generaci�n (Next Gen Stats Star-Driven AI) y elementos de atm�sfera del d�a de juego (Gameday Atmosphere), el d�a de juego din�mico (Dynamic Gameday) ofrece la experiencia de juego m�s inteligente hasta el momento, todo impulsado con datos de la vida real. Dynamic Gameday, Next Gen Stats Star-Driven AI y Gameday Atmosphere son exclusivos de las versiones PlayStation 5 y Xbox Series X|S de Madden NFL 22. **Oferta promocional de preventa de Madden NFL 22 - Esta oferta promocional de preventa caduca el 20 de agosto de 2021. Canjea la oferta antes del 1 de septiembre de 2022 para recibir 20 puntos de personal para el modo Franchise cl�sico, conectado para un jugador ("Puntos de personal"), 1 c�psula Vanity de atleta de portada, 1 art�culo de un jugador estrella de la NFL Elite y el desbloqueo de 10 niveles en la clase de jugador "General" para el avatar del jugador en Face of the Franchise y The Yard.',2,1),
	 ('Ghost of Tsushima','1639948441833.jpg','2021-12-19 21:14:01',NULL,NULL,11989,'A finales del siglo XII, el Imperio Mongol ha puesto residuos a todas las naciones a lo largo de su campa�a para conquistar el Oriente. La isla Tsushima es todo lo que se encuentra entre Jap�n continental y una enorme flota de invasi�n mongol dirigida por el general despiadado y astutuoso, Khotun Khan. A medida que la isla se quema en la caminata de la primera ola del asalto Mongol, el valiente guerrero samur�i Jin Sakai se mantiene resuelto. Como uno de los �ltimos miembros supervivientes de su clan, Jin est� decidido a hacer lo que necesite, a cualquier costo, para proteger a su pueblo y recuperar su hogar. Debe dejar de lado las tradiciones que lo han formado como guerrero para forjar un nuevo camino, el camino del fantasma, y salvar una guerra no convencional por la libertad de Tsushima. Ghost of Tsushima DIRECTOR''S CUT incluye: juego completo. - Expansi�n Iki Island: nueva historia, mini-juegos, tipos enemigos y m�s. - Modo cooperativo en l�nea Legends. - Mini libro de arte digital de Dark Horse. - Comentario del director: el equipo creativo se asienta con un famoso historiador japon�s para mirar el mundo de Ghost of Tsushima y c�mo se compara con los eventos de la vida real que lo inspir�. - Un punto t�cnico. - Dije del recuerdo de Hachiman. - Juego de piel de h�roe de Tsushima: m�scara dorada, kit de espada, caballo, sill�n.',2,1),
	 ('Jurassic World Evolution ','1639948502569.jpg','2021-12-19 21:15:02',NULL,NULL,7895,'Jurassic World Evolution 2 es la secuela tan esperada de la exitosa evoluci�n Jurassic World Evolution, bas�ndose en la innovadora e inmersiva simulaci�n de gesti�n de 2018. Introduce una campa�a atractiva, nueva y narrativa, nuevas caracter�sticas incre�bles y nuevos dinosaurios sorprendentes que cobran vida con una autenticidad cautivadora. Junto con una construcci�n ampliada y m�s opciones de personalizaci�n, el resultado es un juego a�n m�s grande, mejor y aut�ntico de Jurassic World.',2,3),
	 ('NASCAR HEAT Ultimate Edition+','1639948566643.jpg','2021-12-19 21:16:06',NULL,NULL,12789,'NASCAR Heat Ultimate Edition+, el videojuego oficial de la temporada 2020, la serie de carreras de stockcar m�s popular del mundo te pone al volante y te desaf�a a convertirte en el campe�n de la serie NASCAR Cup Series. Cuenta con los equipos oficiales de 2020, pilotos, coches y horarios de las tres NASCAR National Series, as� como el Xtreme Dirt Tour, compitiendo en 39 pistas aut�nticas. Ultimate Edition+ incluye todo en NASCAR Heat 5 Ultimate Edition, adem�s de la NASCAR Cup Series Roster 2021 y esquemas de pintura primaria 2021. El contenido destacado incluye esquemas de pintura Throwback y Playoff 2020, Tony Stewart como personaje jugable, �y m�s!',2,2),
	 ('Halo Infinite','1639948615531.jpg','2021-12-19 21:16:55',NULL,NULL,6367,'Cuando toda la esperanza se pierde y el destino de la humanidad cuelga en el equilibrio, el jefe maestro est� listo para enfrentarse al enemigo m�s despiadado que jam�s haya enfrentado. La legendaria serie Halo regresa con la historia m�s amplia de Master Chief hasta el momento.',2,3),
	 ('Ratchet & Clank: Rift Apart','1639948660644.jpg','2021-12-19 21:17:40',NULL,NULL,12474,'Los aventureros intergal�cticos han vuelto con un flequillo. Ay�dales a detener una intenci�n rob�tica de conquistar mundos transdimensionales, con su propio universo junto en la l�nea de disparo. Voltea tu camino a casa con un arsenal de armas escandalosas. Experimenta el Shuffle de Rifts dimensional y el juego din�mico. Explora planetas nunca antes vistas y versiones de dimensiones alternativas de viejos favoritos. Caracter�sticas de PS5: siente acciones en el juego a trav�s de la retroalimentaci�n h�ptica del controlador inal�mbrico de doble sentido. Toma el control total de la mec�nica avanzada de armas, hecho posible mediante gatillos adaptativos. Planet-hop a hipervelocidad a trav�s de la carga casi instant�nea del SSD de la consola PS5. Sumerge tus o�dos con Tempest 3D Audio Tech mientras trabajas para salvar el universo. La iluminaci�n y el seguimiento de los rayos mejorados representan deslumbrantes mundos en el juego, mostrados en 4K y HDR n�tidos, din�micos. Elige el modo de rendimiento para disfrutar de 60 fotogramas por segundo de juego. (Con auriculares compatibles). Dynamic 4K y HDR requieren un televisor o pantalla compatible con 4K y HDR.',2,1),
	 ('Disney Classic Games Collection','1639948714943.jpg','2021-12-19 21:18:34',NULL,NULL,11254,'The Expanded Collection: Juega a trav�s de m�ltiples versiones diferentes de los queridos juegos de Aladdin, The Lion King y The Jungle Book que se han creado a lo largo de los a�os, incluyendo tanto versiones de consola como de mano.',2,2),
	 ('Animal Crossing: New Horizons','1639948778749.jpg','2021-12-19 21:19:38',NULL,NULL,14583,'Esc�pate a una isla desierta y crea tu propio para�so mientras exploras, creas y personalizas en el juego Animal Crossing: New Horizons. Su escapada a la isla tiene una gran cantidad de recursos naturales que se pueden utilizar para crear todo, desde herramientas hasta comodidades de criatura. Puede cazar insectos en la grieta del amanecer, decorar su para�so durante todo el d�a, o disfrutar de la puesta de sol en la playa mientras pesca en el oc�ano. La hora del d�a y la temporada coinciden con la vida real, por lo que cada d�a en su isla es una oportunidad para registrarse y encontrar nuevas sorpresas durante todo el a�o.
