	 ('Kena: Bridge of Spirits','1639948910210.jpg','2021-12-19 21:21:50',NULL,NULL,12678,'Una aventura de acci�n basada en historias que combina la exploraci�n con el combate acelerado. Mientras Kena, los jugadores encuentran y crecen un equipo de compa�eros espirituales encantadores llamados Rot, mejorando sus habilidades y creando nuevas formas de manipular el medio ambiente. Kena, un joven gu�a espiritual, viaja a un pueblo abandonado en busca del sagrado santuario de monta�a. Ella lucha por descubrir los secretos de esta comunidad olvidada escondida en un bosque cubierto donde los esp�ritus errantes est�n atrapados. Kena: Bridge of Spirits - Deluxe Edition incluye: juego base, banda sonora digital oficial, personal de Kena �nico, piel de putrefacci�n dorada, hoja de pegatinas exclusivas para minoristas, sombreros de celebraci�n �nicos para la putrefacci�n.',2,1),
	 ('Minecraft Dungeons Hero Edition','1639948951403.jpg','2021-12-19 21:22:31',NULL,NULL,7689,'Lucha a trav�s de un nuevo juego de acci�n y aventura, inspirado en los cl�sicos orugas de calabozos y en el universo de Minecraft. �Viste a los calabozos solos o �nete con amigos! Hasta cuatro jugadores pueden luchar juntos a trav�s de niveles llenos de acci�n, llenos de tesoros y variados, todo en una b�squeda �pica para salvar a los aldeanos y derrotar al malvado Arch-Illager. Descubre un mont�n de poderosas nuevas armas y art�culos que te ayudar�n a derrotar enjambres despiadados de turbas nuevas y desagradables. �Lucha o huye a trav�s de ca�ones, pantanos y, por supuesto, las minas! Cualquier aventurero valiente o tonto suficiente para explorar este mundo bloqueado y hermoso tendr� que prepararse. �Tan r�pidamente! Minecraft Dungeons Hero Edition incluye el contenido de Hero Pass DLC: una capa de h�roe, dos pieles de jugadores y una mascota de pollo. Tambi�n incluye los paquetes DLC de Jungle Awakens y Creeping Winters.',2,3),
	 ('Mortal Kombat 11 Ultimate','1639949001074.jpg','2021-12-19 21:23:21',NULL,NULL,11590,'Preordena y obt�n el paquete de piel de los guerreros del tiempo con saibot de red oscura, HCF Liu Kang & blood Moon skarlet. La experiencia definitiva Mk11. Toma el control de los protectores de la tierra en las dos campa�as de historias aclamadas del juego mientras corren para evitar que Kronika rebobinar el tiempo y reiniciar la historia. Las amistades se prueban, y se forjan nuevas alianzas en la batalla para salvar toda la existencia. Mk11 Ultimate cuenta con la lista completa de 37 personajes, incluyendo nuevas adiciones Rain Mileena & Rambo. Mortal Kombat 11 muestra cada divertida amistad, mortal mortal y golpe mortal como nunca antes. Estar�s tan cerca de la lucha que puedes sentirlo. Incluye Mortal Kombat 11, Kombat Pack 1, expansi�n postmatem�ticas y Kombat Pack 2. Mk11 Ultimate est� habilitado para entrega inteligente e incluye actualizaciones gratuitas en la serie Xbox X: resoluci�n din�mica 4K, im�genes mejoradas, tiempos de carga significativamente mejorados y compatibilidad Cross-Platform/CrossGen.',2,3),
	 ('PlayStation 5','1639949080925.jpg','2021-12-19 21:24:40',NULL,NULL,210999,'La consola PS5 desata nuevas posibilidades de juego que nunca esperabas. Experimenta una carga r�pida con un SSD de alta velocidad, inmersi�n m�s profunda con soporte para retroalimentaci�n t�ctil, disparadores adaptativos y audio 3D, y una nueva generaci�n de incre�bles juegos de PlayStation.',1,1),
	 ('Xbox Series S','1639949133465.jpg','2021-12-19 21:25:33',NULL,NULL,89999,'Obt�n el paquete totalmente digital Xbox Series S � Fortnite & Rocket League con el Midnight Drive Pack, 1,000 V-Bucks, y 1,000 cr�ditos de Rocket League. Con el paquete Midnight Drive para Fortnite, puedes personalizar tu avatar con el traje Dark Skully, Dark Skully Satchel Back Bling, Dark Splitter Pickaxe, y 1,000 V-Bucks para pasar en art�culos favoritos en Fortnite Battle Royale y m�s. Para el contenido adicional de Rocket League, obtienes el destacado auto Masamune Purple Virtual Wave Boost, Purple Zefram Wheels y 1.000 Credits de Rocket League que se pueden utilizar para construir Blueprints, actualizar a Rocket Pass Premium, o comprar el contenido m�s deseado de la tienda de art�culos de Rocket League. Y, como Fortnite y Rocket League son libres para jugar con Xbox, puedes jugar directamente con tus amigos.',1,3),
	 ('Nintendo Switch OLED','1639949238614.jpg','2021-12-19 21:27:18',NULL,NULL,124999,'Presentamos al miembro m�s reciente de la familia Nintendo Switch.
